import { Component, Vue, Prop, Watch } from 'vue-property-decorator';
import PersonImg from '@/components/common/person_img.vue';

@Component({
  components: {
    PersonImg,
  },
})
export default class DemandList extends Vue {
  @Prop({default: {}}) private demandItem!: any;
}
